<script id="csinit" type="text/x-cindyscript">
running=false;
li=[];
</script>
<script id="cssimulationstart" type="text/x-cindyscript">
n=100;
pos=1;
l=apply(1..n,B.xy);

li=[];

running=true;
</script>
<script id="csdraw" type="text/x-cindyscript">

draw(D,F,size->3,alpha->0.4);
draw(D,size->4,color->(0,0,0),alpha->0.4);
draw(F,size->4,color->(0,0,0),alpha->0.4);
l_pos=B.xy;


nl=round(200*(|D,G|/|D,F|))+1;

if(length(li)<=nl,
  fillpolygon(li++[A.xy],color->(0.6,0.2,0),alpha->0.4);
  connect([A.xy]++li++[A.xy],color->(0.6,0.2,0),alpha->0.8);
  ss=sum(1..(nl-1),area(li_#,li_(#+1),A.xy));

);
m1=|L,H|;
m2=|L,G|;
m=(m1+m2);
mm1=round((m1/m)*100);
mm2=round((m2/m)*100);

A.mass=(m1/m)*10;
D.mass=(m2/m)*10;
A.mass=10;




drawtext((14.5,6),align->"right","Kinetik = ",family->"Papyrus",size->18);
drawtext((15,6),format((B.ke),4),family->"Papyrus",size->18);
drawtext((14.5,5),align->"right","Potential = ",family->"Papyrus",size->18);
drawtext((15,5),format((simulation().pe),4),family->"Papyrus",size->18);
drawtext((14.5,4),align->"right","Kinetik+Potential = ",family->"Papyrus",size->18);
drawtext((15,4),format((simulation().pe+B.ke),4),family->"Papyrus",size->18);


drawtext((14.5,-9),align->"right","Time = ",family->"Papyrus",size->18);
drawtext((15,-9),format((nl-1)/40,3),family->"Papyrus",size->18);
drawtext((14.5,-8),align->"right","Area = ",family->"Papyrus",size->18);
drawtext((15,-8),format(ss,3),family->"Papyrus",size->18);


if(running,
  apply(2..n-2,i,draw
     (l_(mod(pos-i,n)+1),
      l_(mod(pos-i-1,n)+1),
      alpha->1-(i/n), color->(0.6,0.2,0),size->2
     )
  );

 apply(2..n-2,i,draw
     (l_(mod(pos-i,n)+1),
      l_(mod(pos-i-1,n)+1),
      alpha->(1-(i/n))*0.4, color->(0.6,0.2,0),size->4
     )
  );


  pos=pos+1;

  if(pos==n+1,pos=1);
);




;
</script>
<script id="cstick" type="text/x-cindyscript">
li=[B.xy]++li;
if(length(li)>nl,li=apply(1..nl,li_#));
</script>
<script id="cssimulationstop" type="text/x-cindyscript">
pos=1;
l=apply(1..n,B.xy);

running=false;

li=[];
</script>
